local loadFolders = function()
      local requiredFolders = {
            'amghook';
		'amghook\\assets';
      };

      for i = 1, #requiredFolders do
            local folderName = requiredFolders[i];
            if (not isfolder(folderName)) then
                  makefolder(folderName);
            end;
      end;
end;
local loadAssets = function()
	loadFolders();
	for assetName, assetData in ASSET_IMAGES do
		local filePath = `amghook\\assets\\{assetName}`;
		if (not isfile(filePath)) then
			writefile(filePath, base64_decode(assetData));
		end;
	end;

	-- new
	-- for assetName, assetData in ASSET_IMAGES do
	-- 	ASSET_IMAGES[assetName] = base64_decode(assetData);
	-- end;
end;
local fetchImage = function(name)
	local filePath = `amghook\\assets\\{name}.png`;
	if (not ASSET_IMAGES[`{name}.png`]) then
		return;
	end;
	loadAssets();
	if (not isfile(filePath)) then
		return;
	end;
	return readfile(filePath);
end;

local roundedDrawing = function()

      local properties = {
            Visible     = true;
            Rounding    = 0;
            Size        = vector2(0, 0);
            Color       = Color3.new(0, 0, 0);
            Position    = vector2(0, 0);
            ZIndex      = 0;
      };

      -- Drawings
      local allDrawings = {};

      local middleFill = drawing_new('Square');
      local borderSquare = {
            drawing_new('Square');
            drawing_new('Square');
            drawing_new('Square');
            drawing_new('Square');
      };
      local borderRound = {
            drawing_new('Circle');
            drawing_new('Circle');
            drawing_new('Circle');
            drawing_new('Circle');
      };

      -- setup
      table_insert(allDrawings, middleFill);
      for i = 1, #borderRound do
            borderRound[i].Radius = properties.Rounding;
            borderRound[i].Thickness = 1;
            table_insert(allDrawings, borderRound[i]);
      end;
      for i = 1, #borderSquare do
            table_insert(allDrawings, borderSquare[i]);
      end;

      for i = 1, #allDrawings do
            local drawing = allDrawings[i];
            drawing.Visible  = properties.Visible;
            drawing.Color    = properties.Color;
            drawing.ZIndex   = properties.ZIndex;
            drawing.Filled   = true;
      end;

      -- positions

      local updatePositions = function()
            -- top / bottom
            local tsize = vector2(properties.Size.X - properties.Rounding * 2, properties.Rounding);
            borderSquare[1].Size = tsize;
            borderSquare[2].Size = tsize;

            borderSquare[1].Position = vector2( properties.Position.X + properties.Rounding , properties.Position.Y );
            borderSquare[2].Position = vector2( properties.Position.X + properties.Rounding , properties.Position.Y + properties.Size.Y - properties.Rounding );

            -- right / left
            local rsize = vector2(properties.Rounding, properties.Size.Y - properties.Rounding * 2);
            borderSquare[3].Size = rsize;
            borderSquare[4].Size = rsize;

            borderSquare[3].Position = vector2( properties.Position.X, properties.Position.Y + properties.Rounding );
            borderSquare[4].Position = vector2( properties.Position.X + properties.Size.X - properties.Rounding , properties.Position.Y + properties.Rounding );

            -- circles
            borderRound[1].Position = vector2( properties.Position.X + properties.Rounding, properties.Position.Y + properties.Rounding );
            borderRound[2].Position = vector2( properties.Position.X + properties.Size.X - properties.Rounding, properties.Position.Y + properties.Rounding );
            borderRound[3].Position = vector2( properties.Position.X + properties.Size.X - properties.Rounding, properties.Position.Y + properties.Size.Y - properties.Rounding );
            borderRound[4].Position = vector2( properties.Position.X + properties.Rounding, properties.Position.Y + properties.Size.Y - properties.Rounding );

            middleFill.Position = borderRound[1].Position;
            middleFill.Size = properties.Size - vector2(properties.Rounding * 2, properties.Rounding * 2);

            for i = 1, #borderRound do
                  borderRound[i].Radius = properties.Rounding;
            end;
      end;

      updatePositions();

      -- object
      local object      = newproxy(true);
      local objectMT    = getmetatable(object);

      objectMT.__index = function(self, idx)
            return properties[idx];
      end;
      objectMT.__newindex = function(self, idx, val)

            assert(properties[idx] ~= nil, `{idx} is not a valid member DrawingObject`);
            assert(typeof(val) == typeof(properties[idx]), `{typeof(properties[idx])} expected, got {typeof(val)}`);

            if (properties[idx] == val) then
                  return;
            end;

            properties[idx] = val;
            if (idx == 'Visible' or idx == 'ZIndex' or idx == 'Color') then
                  for i = 1, #allDrawings do
                        allDrawings[i][idx] = val;
                  end;

            elseif (idx == 'Rounding' or idx == 'Size' or idx == 'Position') then
                  updatePositions();
            end;

      end;

      return object;
end;

local createDrawing = function(_type, properties, ...)
	local drawing = _type == 'RoundedSquare' and roundedDrawing() or drawing_new(_type);
	for index, value in properties do
		drawing[index] = value;
	end;
	for _, _table in {...} do
		table_insert(_table, drawing);
	end;
	return drawing;
end;
local createClass = function(_table: table?): table -- Creates an empty class (yea no problem for the info)
	local class = _table or {};
	class.__index = class;
	return class;
end;


