notifyClass.new = function(window, text, time)
	local notification = setmetatable({
		window = window;
		text = text;	
		time = time;

		active = true;
		drawings = {};
	}, notifyClass);

	local notificationOffset = 65;

	local notifications = window.notifications;
	for i = 1, #notifications do
		notificationOffset += notifications[i].offset + 10;
	end;

	-- drawings
	do
		local drawings = notification.drawings;

		drawings.text = createDrawing('Text', {
			Visible           = true;
			Center            = false;
			Outline           = true;
			Transparency      = 1;
			Size              = GLOBAL_SIZE;
			Font              = GLOBAL_FONT;
			Text              = text;
			Color             = color_rgb(195, 195, 195);
			OutlineColor      = color_rgb(0, 0, 0);
			ZIndex            = 9;
		});
		drawings.text.Position = vector2(-drawings.text.TextBounds.X - 5, notificationOffset + 5);

		drawings.background = createDrawing('Square', {
			Visible           = true;
			Filled            = true;
			Transparency      = 1;
			Thickness         = 1;
			Color             = color_rgb(39, 39, 39);
			Position          = drawings.text.Position - vector2(5, 5);
			Size              = drawings.text.TextBounds + vector2(10, 10);
			ZIndex            = 8;
		});

		drawings.background_outline = createDrawing('Square', {
			Visible           = true;
			Filled            = false;
			Transparency      = 1;
			Thickness         = 1;
			Color             = color_rgb(0, 0, 0);
			Position          = drawings.background.Position;
			Size              = drawings.background.Size;
			ZIndex            = 9;
		});

		drawings.accent = createDrawing('Square', {
			Visible           = true;
			Filled            = true;
			Transparency      = 1;
			Thickness         = 1;
			Color             = color_rgb(255, 0, 0);
			Position          = drawings.background.Position - vector2(2, 0);
			Size              = drawings.background.Size + vector2(2, 2);
			ZIndex            = 7;
		});
	end;

	notification.offset = notification.drawings.accent.Size.Y;
	notification.goalPos = vector2(10, notificationOffset);
	notification:moveTo(notification.goalPos, 0.2);
	table_insert(notifications, notification);

	local totalTime = 0;
	notification.connection = runService.RenderStepped:Connect(function(deltaTime)
		totalTime += deltaTime;

		if (totalTime >= time - 0.05) then
			notification.connection:Disconnect();
			notification:remove();
			return;
		end;
	end);

	return notification;
end;
boardClass.new = function(options: table)
	local BASE_ZINDEX = 0;

	local board 	= setmetatable({
		active 	      = options.active;
		title 	      = options.title;
		size		      = options.size;
		position 		= options.position or vector2(camera.ViewportSize.X - options.size.X - 10, camera.ViewportSize.Y / 2 - options.size.Y / 2);
            mouseHeld         = false;

            storage           = {};
            storedText        = {};
            clickDetectors    = {};

		drawings 	      = {};
            cachedDrawings    = {};
            allDrawings       = {};
            
	}, boardClass);
      
	-- drawings
	do
            local drawings	= board.drawings;

		drawings.base	= createDrawing('Square', {
			Visible           = board.active;
			Filled            = true;
			Transparency      = 1;
			Thickness         = 1;
			Color             = color_rgb(39, 39, 39);
			Position          = board.position;
			Size              = board.size;
			ZIndex            = 8;
		}, board.allDrawings);

		drawings.onDrag	= createDrawing('Square', {
			Visible           = board.active;
			Filled            = false;
			Transparency      = 1;
			Thickness         = 1;
			Color             = color_rgb(255, 42, 191);
			Position          = drawings.base.Position;
			Size              = vector2(board.size.X, 22);
			ZIndex            = 0;
		},  board.allDrawings);

		drawings.baseOutline = createDrawing('Square', {
			Visible           = board.active;
			Filled            = false;
			Transparency      = 1;
			Thickness         = 1;
			Color             = color_rgb(7, 7, 7);
			Position          = drawings.base.Position - vector2(1, 1);
			Size              = drawings.base.Size + vector2(2, 2);
			ZIndex            = 9;
		}, board.allDrawings);

		drawings.title = createDrawing('Text', {
			Visible           = board.active;
			Center            = true;
			Outline           = true;
			Transparency      = 1;
			Size              = GLOBAL_SIZE;
			Font              = GLOBAL_FONT;
			Text              = board.title;
			Color             = color_rgb(255, 255, 255);
			OutlineColor      = color_rgb(0, 0, 0);
			Position          = drawings.base.Position + vector2(drawings.base.Size.X / 2, 2);
			ZIndex            = 9;
		}, board.allDrawings);
	end;

	-- setup
	do
            local clickDetectors = board.clickDetectors;


            userInputService.InputBegan:Connect(function(input, gameProcessed)
                  if (input.UserInputType ~= Enum.UserInputType.MouseButton1) then
				return;
			end;
			board.mouseHeld = true;

			local mousePosition = userInputService:GetMouseLocation();
			for i = 1, #clickDetectors do
				clickDetectors[i](mousePosition);
			end;
		end);

		userInputService.InputEnded:Connect(function(input, gameProcessed)
			if (input.UserInputType ~= Enum.UserInputType.MouseButton1) then
				return;
			end;
			board.mouseHeld = false;
		end);

            local onDrag = function(mousePosition)

			local positions = {};
			for i = 1, #board.allDrawings do
				positions[i] = board.allDrawings[i].Position;
			end;


			local connection;
			connection = runService.RenderStepped:Connect(function()
				if (not board.mouseHeld) then
					return connection:Disconnect();
				end;

				local offset = userInputService:GetMouseLocation() - mousePosition;

				for i = 1, #positions do
					board.allDrawings[i].Position = positions[i] + offset;
				end;
			end);

		end;

		board:onClick(board.drawings.onDrag, onDrag);
	end;

      return board;
end;
