	local toggled_onClick = function()
		local active = not colourpicker.drawings.background_fill.Visible;

		local all_toggleDrawings = colourpicker.tab.toggleDrawings;
		local toggleDrawings = colourpicker.onToggle;

		-- toggle caches
		for _, value in colourpicker.window.cachedImages do
			if (value.toggle) then
				value.drawing.Visible = false;
			end;
		end;

		for i = 1, #all_toggleDrawings do
			all_toggleDrawings[i].Visible = false;
		end;
		for i = 1, #toggleDrawings do
			toggleDrawings[i].Visible = active;
		end;

		if (active) then

			local huefill 	= colourpicker.window.cachedImages['cp_huefill'].drawing;
			local overlay 	= colourpicker.window.cachedImages['cp_overlay'].drawing;

			huefill.Position 	= colourpicker.drawings.colourpicker_fill.Position + vector2(colourpicker.drawings.colourpicker_fill.Size.X + 5, 0);
			overlay.Position 	= colourpicker.drawings.background_fill.Position + vector2(5, 5);

			huefill.Visible	= true;
			overlay.Visible	= true;
		end;

	end;
	local hue_onClick = function()
		local hueOutline 	= colourpicker.drawings.hue_outline;
		local startingY 	= hueOutline.Position.Y;
		local sizeY 	= hueOutline.Size.Y;

		local connection;
		connection = runService.RenderStepped:Connect(function()
			if (not colourpicker.window.mouseHeld) then
				return connection:Disconnect();
			end;
			local percentage = math_clamp( (userInputService:GetMouseLocation().Y - startingY) / sizeY, 0, 1);
			colourpicker.h = percentage;

			local drawings 	= colourpicker.drawings;
			local hueOutline	= drawings.hue_outline;

			drawings.huepicker.Position = hueOutline.Position + vector2(-2, math_round((sizeY - 6) * percentage));
			drawings.huepicker_outline.Position = drawings.huepicker.Position;

			colourpicker:updateHue();
		end);
	end;
	local colourpick_onClick = function()
		local drawings = colourpicker.drawings;

		local colourpickerOutline 	= drawings.colourpicker_outline;
		local maxSize 			= colourpickerOutline.Size;
		local basePosition 		= colourpickerOutline.Position;

		local maxColourBounds		= colourpickerOutline.Size - vector2(6, 6);

		local connection;
		connection = runService.RenderStepped:Connect(function()
			if (not colourpicker.window.mouseHeld) then
				return connection:Disconnect();
			end;
			local percentage = (userInputService:GetMouseLocation() - basePosition) / maxSize;
			colourpicker.s, colourpicker.v = math_clamp(percentage.X, 0, 1), math_abs(math_clamp(percentage.Y, 0, 1) - 1);

			local position = colourpickerOutline.Position + vector2(maxColourBounds.X * colourpicker.s, maxColourBounds.Y * math_abs(colourpicker.v - 1));
			position = vector2(math_round(position.X), math_round(position.Y));

			drawings.colourpick.Position 		= position;
			drawings.colourpick_outline.Position= position;

			colourpicker:update_SaturationValue();
		end);
	end;

	colourpicker.window:onClick(colourpicker.drawings.colour_outline, toggled_onClick);
	colourpicker.window:onClick(colourpicker.drawings.hue_outline, hue_onClick, nil, true);
	colourpicker.window:onClick(colourpicker.drawings.colourpicker_outline, colourpick_onClick, nil, true);

	colourpicker:update();

	return colourpicker;
end;

-- notifyClass functions
do
	function notifyClass:moveTo(position, time)
		if (self.move_connection) then
			self.move_connection:Disconnect();
			self.move_connection = nil;
		end;

		local allDrawings = self.drawings;
		local basePos 	= allDrawings.background.Position;
		local offset	= position - basePos;
		
		local basePositions = {};
		for i, drawing in allDrawings do
			basePositions[i] = drawing.Position;
		end;

		local totalTime = 0;
		self.move_connection 	= runService.RenderStepped:Connect(function(deltaTime)
			totalTime += deltaTime;
			if (totalTime >= time) then
				for i, position in basePositions do
					allDrawings[i].Position = position + offset;
				end;
				self.move_connection:Disconnect();
				self.move_connection = nil;
				return;
			end;
			
			local percentage = totalTime / time;
			for i, position in basePositions do
				allDrawings[i].Position = position + offset * percentage;
			end;
		end);
	end;

	function notifyClass:remove()
		local notifications 	= self.window.notifications;
		local allDrawings 	= self.drawings;

		local offset 		= self.offset + 10;
		local index 		= table_find(notifications, self);

		table_remove(notifications, index);
		self:moveTo(vector2(10, -offset), 0.05);

		local totalTime = 0;
		self.connection = runService.RenderStepped:Connect(function(deltaTime)
			totalTime += deltaTime;
	
			if (totalTime >= 0.05) then
				for _, drawing in allDrawings do
					drawing:Remove();
				end;
				self.connection:Disconnect();
				return;
			end;
		end);
		for i = 1, #notifications do
			if (i < index) then
				continue;
			end;
			local notification = notifications[i];
			notification.goalPos -= vector2(0, offset);
			notification:moveTo(notification.goalPos, 0.05);
		end;
	end;
end;

-- boardClass function
do
      function boardClass:toggle(enabled)
		if (enabled == nil) then
			enabled = not self.active;
		end;
		self.active       = enabled;
            self.mouseHeld    = false;

		for i = 1, #self.allDrawings do
			self.allDrawings[i].Visible = enabled;
		end;

            if (enabled) then
                  for _, textInfo in self.storedText do
                        textInfo.drawing.Visible = textInfo.shown;
                  end;
            end;
      end;

      function boardClass:isWithin(drawing, mousePosition)
		local size 		= drawing.Size;
		local offset 	= mousePosition - drawing.Position;

		return (
			offset.X > 0 and offset.Y > 0 and
			offset.X < size.X and offset.Y < size.Y
		);
	end;
      function boardClass:onClick(drawing, onClick)
		local onClicked = function(mousePosition)
			if (drawing.Visible and self:isWithin(drawing, mousePosition)) then
				return onClick(mousePosition);
			end;
		end;
		table_insert(self.clickDetectors, onClicked);
	end;

	function boardClass:getScale()
		return self.drawings.base.Position / camera.ViewportSize;
	end;
	function boardClass:setScale(scale: Vector2)

		local position 		= scale * camera.ViewportSize
		local offset 		= position - self.drawings.base.Position;

		self.mouseHeld    	= false;

		for i = 1, #self.allDrawings do
			self.allDrawings[i].Position += offset;
		end;
	end;

      function boardClass:addText(side, text, colour, shown)
            
            local textInfo = {
                  side        = side;
                  text        = text;
			shown 	= shown == nil and true or shown;
                  colour      = colour;
                  drawing     = self.cachedDrawings[1];
            };

            if (not textInfo.drawing) then -- drawing cacher
                  -- print((self.active and textInfo.shown) or false);
                  textInfo.drawing = createDrawing('Text', {
                        Visible           = (self.active and textInfo.shown) or false;
                        Center            = false;
                        Outline           = true;
                        Transparency      = 1;
                        Size              = GLOBAL_SIZE;
                        Font              = GLOBAL_FONT;
                        Text              = textInfo.text;
                        Color             = textInfo.colour;
                        OutlineColor      = color_rgb(0, 0, 0);
                        -- Position          = drawings.base.Position + vector2(drawings.base.Size.X / 2, 2);
                        ZIndex            = 9;
                  }, self.allDrawings);
            else
                  table_remove(self.cachedDrawings, 1);

                  textInfo.drawing.Visible      = (self.active and textInfo.shown) or false;
                  textInfo.drawing.Color        = textInfo.colour;
                  textInfo.drawing.Text         = textInfo.text;
            end;

            local index = 0;
            for i = 1, #self.storedText do
                  if (self.storedText[i].side == textInfo.side and textInfo.shown) then
                        index += 1;
                  end;
            end;

            textInfo.drawing.Position = self.drawings.base.Position + vector2(
                  side == 'left' and 2 or self.drawings.base.Size.X - textInfo.drawing.TextBounds.X - 2,
                  index * 20 + 27
            );

            table_insert(self.storedText, textInfo);
            return textInfo;
      end;
      function boardClass:removeText(side, text)
            
            local removed     = false;
            local index       = 0;

            for i, textInfo in self.storedText do
                  if (textInfo.side ~= side) then
                        continue;
                  elseif (removed) then
                        -- print('adjusting text pos', index, textInfo.text)
                        self.mouseHeld = false;

                        textInfo.drawing.Position = self.drawings.base.Position + vector2(
                              side == 'left' and 2 or self.drawings.base.Size.X - textInfo.drawing.TextBounds.X - 2,
                              (index - 1) * 20 + 27
                        );

                  elseif (textInfo.text == text) then
                        removed = true;

                        textInfo.drawing.Visible = false;
                        table_insert(self.cachedDrawings, textInfo.drawing);
                        table_remove(self.storedText, i);
                  end;

                  index += 1;
            end;

      end;

      function boardClass:update()

		local leftIndex 	= 0;
		local rightIndex 	= 0;

            for _, textInfo in self.storedText do

                  local drawing 	= textInfo.drawing;
			local side 		= textInfo.side;

                  drawing.Visible = self.active and textInfo.shown;

                  if not (textInfo.text == drawing.Text and textInfo.colour == drawing.Color) then
                        drawing.Text      = textInfo.text;
                        drawing.Color     = textInfo.colour;
                  end;
			if (textInfo.shown) then

				textInfo.drawing.Position = self.drawings.base.Position + vector2(
					side == 'left' and 2 or self.drawings.base.Size.X - textInfo.drawing.TextBounds.X - 2,
					(side == 'left' and leftIndex or rightIndex ) * 20 + 27
				);
				
				if (textInfo.side == 'left') then
					leftIndex += 1;
				else
					rightIndex += 1;
				end;
			end;
            end;

            local ySize = 27 + math.max(leftIndex, rightIndex) * 20;
            local xSize = self.drawings.base.Size.X;

            self.drawings.base.Size = vector2(xSize, ySize);
            self.drawings.baseOutline.Size = vector2(xSize + 2, ySize + 2);
      end;

      function boardClass:findText(side, text)
            for _, textInfo in self.storedText do
                  if (textInfo.text == text and textInfo.side == side) then
                        return textInfo;
                  end;
            end;
      end;
end;

