		);
	end;
      function targethudClass:onClick(drawing, onClick)
		local onClicked = function(mousePosition)
			if (drawing.Visible and self:isWithin(drawing, mousePosition)) then
				return onClick(mousePosition);
			end;
		end;
		table_insert(self.clickDetectors, onClicked);
	end;


	function targethudClass:getScale()
		return self.drawings.base.Position / camera.ViewportSize;
	end;
	function targethudClass:setScale(scale: Vector2)

		local position 		= scale * camera.ViewportSize
		local offset 		= position - self.drawings.base.Position;

		self.mouseHeld    	= false;

		for i = 1, #self.allDrawings do
			self.allDrawings[i].Position += offset;
		end;
	end;

	function targethudClass:setName(name: string)
		if (name and self.values.name ~= name) then
			self.drawings.name.Text = name;
		end;
	end;
	function targethudClass:setDistance(distance: string)
		if (distance and self.values.distance ~= distance) then
			self.drawings.distance.Text = `distance: {distance} studs`;
		end;
	end;
	function targethudClass:setWeapon(weapon: string)
		if (weapon and self.values.weapon ~= weapon) then
			self.drawings.weapon.Text = `weapon: {weapon}`;
		end;
	end;
	function targethudClass:setHealth(health: number, maxHealth: number)
		if (not health or not maxHealth or self.values.health == health or self.values.maxHealth == maxHealth) then
			return;
		end;

		local maxSize 		= 278;
		local healthPerc 		= health / maxHealth;

		local healthColour 	= color_rgb(255, 0, 0):Lerp(color_rgb(0, 255, 0), healthPerc);

		self.drawings.healthbar.Size 	= vector2(maxSize * healthPerc, 6);
		self.drawings.healthbar.Color = healthColour;
	end;
